// Navbar.js
import { Link } from "react-router-dom";
import React from "react";
import { useAuth } from "./AuthContext";

const Navbar = () => {
    const { authenticated } = useAuth();

    return (
        <div>
            <nav>
                <div>
                    <Link to="/">Home</Link>
                </div>
                {authenticated && (
                    <div>
                        <Link to="/login">Login</Link>
                    </div>
                )}
            </nav>
        </div>
    );
};

export default Navbar;
